  [],\n\t\"revision_timestamp\": \"2016-05-31T01:08:11.876682\",\n\t\"name\": \"alaska-phocid-food-habits\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Relatively little is known of the diet
  and foraging behaviors of the four species of ice-associated seals (ribbon seal,
  bearded seal, spotted seal, and ringed seal) and harbor seals in Alaska. What is
  known comes largely from stomach contents of animals harvested during subsistence
  hunting near coastal communities. Diet and foraging ecology are likely highly sensitive
  to the availability of suitable habitats and sea ice conditions. They may be particularly
  vulnerable to climatic change and other disruptions from more direct anthropogenic
  effects such as offshore oil and gas development. Our ability to predict and manage
  for such impacts, however, is limited by our inadequate knowledge of seal ecology.
  This database contains diet data obtained by scat samples from seals across a variety
  of research projects. Scat samples were collected from ribbon and spotted seals
  in the pack ice in the Bering Sea during April, May, and June of 2007-2010, and
  2014. The diet data in this database were obtained by analyzing otoliths from these
  scats. Scat samples have also been collected from harbor seals from Lake Iliamna
  in July-August 2015, and from the Aleutian Islands in September 2015. Diet data
  based on otoliths from these scats will also be recorded in this dataset.\",\n\t\"license_title\":
